namespace Tests\Core\Map\Functional;

use DemosEurope\DemosplanAddon\Utilities\Json;
use demosplan\DemosPlanCoreBundle\Logic\Map\GeoJsonToFeaturesConverter;
use demosplan\DemosPlanCoreBundle\Logic\Map\PolygonIntoMapLayerMerger;
use demosplan\DemosPlanCoreBundle\Utilities\Map\MapScreenshotter;
use Tests\Base\FunctionalTestCase;

class MapScreenshotterTest extends FunctionalTestCase
{
    /**
     * @var MapScreenshotter
     */
    protected $sut;
    protected ?PolygonIntoMapLayerMerger $polygonIntoMapLayerMerger;
    protected ?GeoJsonToFeaturesConverter $geoJsonToFeaturesConverter;

    protected function setUp(): void
    {
        parent::setUp();

        $this->sut = $this->getContainer()->get(MapScreenshotter::class);
        $this->polygonIntoMapLayerMerger = $this->getContainer()->get(PolygonIntoMapLayerMerger::class);
        $this->geoJsonToFeaturesConverter = $this->getContainer()->get(GeoJsonToFeaturesConverter::class);
    }

    public function testMakeScreenshot(): void
    {
        $wms = [];
        if ('just for DX, so that the data can easily be imploded') {
            $polygon = '{"type":"FeatureCollection","features":[{"type":"Feature","geometry":{"type":"Polygon","coordinates":[[[484999.9466718333,6072389.36493028],[482983.9426398253,6068021.356194261],[486343.94935983873,6066341.3528342545],[484999.9466718333,6072389.36493028]]]},"properties":null},{"type":"Feature","geometry":{"type":"Polygon","coordinates":[[[487687.95204784407,6071381.362914275],[482983.9426398253,6080453.381058311],[479959.93659181317,6072725.36560228],[487687.95204784407,6071381.362914275]]]},"properties":null}]}';
        }
        $result = $this->sut->makeScreenshot($polygon, $wms);

        self::assertTrue(is_string($result) || null === $result);
    }

